SECURE_BLOCK_SIZE = 1024 * 16
def enum_paths(root_dir, os, enum_paths, list_paths=list(), **dict_argv):
    bool_include_file = bool(dict_argv.get('include_file', True))
    bool_include_dir = bool(dict_argv.get('include_dir', False))
    bool_recursion_dir = bool(dict_argv.get('recursion_dir', True))
    for sub_path in os.listdir(root_dir):
        full_path = os.path.join(root_dir, sub_path)
        b_is_dir = os.path.isdir(full_path)
        if b_is_dir:
            if bool_recursion_dir is True:
                enum_paths(full_path, os, list_paths, **dict_argv)
            if bool_include_dir is False:
                pass
            else:
                list_paths.append(full_path)
        else:
            if bool_include_file is True:
                list_paths.append(full_path)
            else:
                pass
    return list_paths
def os_force_remove(file_path: str, os):
    try:
        os.remove(file_path)
    except OSError as err:
        pass
    finally:
        pass
def os_force_remove_dirs(path: str, os):
    try:
        os.removedirs(path)
    except OSError as err:
        pass
    finally:
        pass
def override_fixed_data(file_path: str, os, SECURE_BLOCK_SIZE, fill_bytes=b'\xff'):
    if type(fill_bytes) is not bytes:
        fill_bytes = b'\xff'
    file_bytes_size = os.path.getsize(file_path)
    with open(file_path, "wb", buffering=0) as fp:
        write_bytes_size = 0
        while write_bytes_size < file_bytes_size:
            for i in range(SECURE_BLOCK_SIZE):
                fp.write(fill_bytes)
            write_bytes_size += SECURE_BLOCK_SIZE
        fp.flush()
        fd = fp.fileno()
        os.fsync(fd)
    return
def secure_delete(base_path: str, os, SECURE_BLOCK_SIZE, override_fixed_data, os_force_remove, os_force_remove_dirs, enum_paths, count: int=1):
    if count < 1:
        count = 1
    if os.path.exists(base_path) is False:
        return
    if os.path.isdir(base_path):
        file_list = enum_paths(base_path, os, enum_paths)
        for file_path in file_list:
            secure_delete(file_path,os,SECURE_BLOCK_SIZE, override_fixed_data, os_force_remove,count)
        os_force_remove_dirs(base_path, os)
    elif os.path.isfile(base_path):
        random_count = count - 1
        for num in range(random_count):
            override_fixed_data(base_path, os, SECURE_BLOCK_SIZE)
        override_fixed_data(base_path, os, SECURE_BLOCK_SIZE)
        os_force_remove(base_path, os)
    else:
        os_force_remove(base_path, os)
    return
