def daemon(func, args=[]):
    import os
    import sys
    try: 
        pid = os.fork()
        if pid > 0:
            return
    except OSError as e:
        _print(sys.stderr, "fork #1 failed: %d (%s)" % (e.errno, e.strerror))
        sys.exit(1)
    os.setsid()
    try: 
        pid = os.fork()
        if pid > 0:
            sys.exit(0)
    except OSError as e:
        _print(sys.stderr, "fork #2 failed: %d (%s)" % (e.errno, e.strerror))
        sys.exit(1)
    func(*args)
